import React, { Component } from "react";
import Courselist from "../courselist/courselist";
import Navbar from "../navbar/navbar";
import Forum from '../Forum/Forum';
import Mentor from '../Mentor/Mentor';
import Tutors from '../Tutors/Tutors';
import "./App.css";

class App extends Component {
  state = {
    courses: [
      {
        name: "Year 1",
        url: "https://wastedpotnetial.discussion.community/?forum=773704 "
      },
      {
        name: "Year 2",
        url: "https://wastedpotnetial.discussion.community/?forum=773699"
      },
      {
        name: "Year 3",
        url: "https://wastedpotnetial.discussion.community/?forum=773712"
      },
      {
        name: "Year 4",
        url: "https://wastedpotnetial.discussion.community/?forum=773713"
      }
    ],

    prof : [
      {
        name: 'Dr. So and So',
        subject: 'Algorithms'
      },

      {
        name: 'Dr. So and So',
        subject: 'Algorithms'
      },
      {
        name: 'Dr. So and So',
        subject: 'Algorithms'
      },
      {
        name: 'Dr. So and So',
        subject: 'Algorithms'
      },
    ]
  };
  render() {
    return (
      <div>
        <Navbar />
        <Courselist courses={this.state.courses} />
        <Forum />
        <Mentor />
        <Tutors/>
      </div>
    );
  }
}

export default App;
